CREATE TABLE [s03].[dimensions] (
      [id] tinyint NOT NULL
    , [code] nvarchar(50) NOT NULL
    , [name] nvarchar(50) NOT NULL
    , CONSTRAINT [PK_dimensions] PRIMARY KEY ([id])
    , CONSTRAINT [IX_dimensions_code] UNIQUE ([code])
    , CONSTRAINT [IX_dimensions_name] UNIQUE ([name])
);
GO

CREATE TABLE [s03].[members] (
      [id] int IDENTITY(1,1) NOT NULL
    , [dimension_id] tinyint NOT NULL
    , [code] nvarchar(50) NOT NULL
    , [name] nvarchar(255) NOT NULL
    , CONSTRAINT [PK_members] PRIMARY KEY ([id])
    , CONSTRAINT [IX_members_code] UNIQUE ([code])
    , CONSTRAINT [IX_members_name] UNIQUE ([name])
);
GO

ALTER TABLE [s03].[members] ADD CONSTRAINT [FK_members_dimensions] FOREIGN KEY ([dimension_id]) REFERENCES [s03].[dimensions] ([id]) ON UPDATE CASCADE;
GO

CREATE TABLE [s03].[reports] (
      [category_id] int NOT NULL
    , [time_id] int NOT NULL
    , [row_index] int NOT NULL
    , [row_id] int NULL
    , [report] int NULL
    , [row_level] int NULL
    , [row_format] int NULL
    , [zero] int NULL
    , [hide] int NULL
    , [section] nvarchar(50) NULL
    , [account] nvarchar(50) NULL
    , [code1] nvarchar(50) NULL
    , [code2] nvarchar(50) NULL
    , [data_key] nvarchar(100) NULL
    , [data_index] int NULL
    , [code] nvarchar(50) NULL
    , [name] nvarchar(255) NULL
    , [data00] float NULL
    , [data01] float NULL
    , [data02] float NULL
    , [data03] float NULL
    , [data04] float NULL
    , [data05] float NULL
    , [data06] float NULL
    , [data07] float NULL
    , [data08] float NULL
    , [data09] float NULL
    , [data10] float NULL
    , [data11] float NULL
    , [data12] float NULL
    , [transaction_start_time] datetime NULL
    , CONSTRAINT [PK_budget_reports] PRIMARY KEY ([category_id], [time_id], [row_index])
);
GO

ALTER TABLE [s03].[reports] ADD CONSTRAINT [FK_reports_members_category_id] FOREIGN KEY ([category_id]) REFERENCES [s03].[members] ([id]) ON UPDATE CASCADE;
GO

ALTER TABLE [s03].[reports] ADD CONSTRAINT [FK_reports_members_time_id] FOREIGN KEY ([time_id]) REFERENCES [s03].[members] ([id]);
GO

CREATE TABLE [s03].[requests] (
      [id] int IDENTITY(1,1) NOT NULL
    , [entity_id] int NOT NULL
    , [category_id] int NOT NULL
    , [time_id] int NOT NULL
    , [row_index] int NOT NULL
    , [row_format] int NULL
    , [comment] nvarchar(255) NULL
    , [account_id] int NULL
    , [subaccount_id] int NULL
    , [product_id] int NULL
    , [region_id] int NULL
    , [total] float NULL
    , [01] float NULL
    , [02] float NULL
    , [03] float NULL
    , [04] float NULL
    , [05] float NULL
    , [06] float NULL
    , [07] float NULL
    , [08] float NULL
    , [09] float NULL
    , [10] float NULL
    , [11] float NULL
    , [12] float NULL
    , [row_formulas] nvarchar(max) NULL
    , [row_comments] nvarchar(max) NULL
    , [transaction_start_time] datetime NULL
    , [is_empty] AS (CONVERT([bit],case when [comment] IS NOT NULL OR [account_id] IS NOT NULL OR [subaccount_id] IS NOT NULL OR [product_id] IS NOT NULL OR [01] IS NOT NULL OR [02] IS NOT NULL OR [03] IS NOT NULL OR [04] IS NOT NULL OR [05] IS NOT NULL OR [06] IS NOT NULL OR [07] IS NOT NULL OR [08] IS NOT NULL OR [09] IS NOT NULL OR [10] IS NOT NULL OR [11] IS NOT NULL OR [12] IS NOT NULL then (0) else (1) end))
    , CONSTRAINT [PK_requests] PRIMARY KEY ([id])
    , CONSTRAINT [IX_requests] UNIQUE ([category_id], [time_id], [entity_id], [row_index])
);
GO

