ALTER TABLE [s03].[requests] ADD CONSTRAINT [FK_requests_members_region_id] FOREIGN KEY ([region_id]) REFERENCES [s03].[members] ([id]);
GO

ALTER TABLE [s03].[requests] ADD CONSTRAINT [FK_requests_members_subaccount_id] FOREIGN KEY ([subaccount_id]) REFERENCES [s03].[members] ([id]);
