-- =============================================
-- Author:      Gartle LLC
-- Release:     10.0, 2022-07-05
-- Description: The procedure selects aggregate data from s03.requests
-- =============================================

CREATE PROCEDURE [s03].[usp_data]
    @category_id int = NULL
    , @time_id int = NULL
    , @entity_id int = NULL
AS
BEGIN

SET NOCOUNT ON

SELECT
    t.section + '.' + m3.code + COALESCE('.' + m4.code, '') + COALESCE('.' + m5.code, '') + COALESCE('.' + m6.code, '') + COALESCE('.' + m7.code, '') AS code
    , t.section
    , m1.code AS category
    , m2.code AS [time]
    , m3.code AS account
    , m3.name AS account_name
    , m4.code AS entity
    , m4.name AS entity_name
    , m5.code AS region
    , m5.name AS region_name
    , m6.code AS product
    , m6.name AS product_name
    , m7.code AS subaccount
    , m7.name AS subaccount_name
    , COALESCE([01], 0) + COALESCE([02], 0) + COALESCE([03], 0) + COALESCE([04], 0) + COALESCE([05], 0) + COALESCE([06], 0) + COALESCE([07], 0) + COALESCE([08], 0) + COALESCE([09], 0) + COALESCE([10], 0) + COALESCE([11], 0) + COALESCE([12], 0) AS total
    , [01], [02], [03], [04], [05], [06], [07], [08], [09], [10], [11], [12]
FROM
    (
        SELECT
            'accounts' AS section
            , t.category_id
            , t.time_id
            , t.account_id
            , NULL AS entity_id
            , NULL AS product_id
            , NULL AS region_id
            , NULL AS subaccount_id
            , SUM(t.[01]) AS [01]
            , SUM(t.[02]) AS [02]
            , SUM(t.[03]) AS [03]
            , SUM(t.[04]) AS [04]
            , SUM(t.[05]) AS [05]
            , SUM(t.[06]) AS [06]
            , SUM(t.[07]) AS [07]
            , SUM(t.[08]) AS [08]
            , SUM(t.[09]) AS [09]
            , SUM(t.[10]) AS [10]
            , SUM(t.[11]) AS [11]
            , SUM(t.[12]) AS [12]
        FROM
            s03.requests t
        WHERE
            t.category_id = @category_id
            AND t.time_id = @time_id
            AND t.entity_id = COALESCE(@entity_id, t.entity_id)
        GROUP BY
            t.category_id
            , t.time_id
            , t.account_id
        HAVING
            account_id IS NOT NULL
        UNION ALL
        SELECT
            'entities' AS section
            , t.category_id
            , t.time_id
            , t.account_id
            , t.entity_id
            , NULL AS product_id
            , NULL AS region_id
            , NULL AS subaccount_id
            , SUM(t.[01]) AS [01]
            , SUM(t.[02]) AS [02]
            , SUM(t.[03]) AS [03]
            , SUM(t.[04]) AS [04]
            , SUM(t.[05]) AS [05]
            , SUM(t.[06]) AS [06]
            , SUM(t.[07]) AS [07]
            , SUM(t.[08]) AS [08]
            , SUM(t.[09]) AS [09]
            , SUM(t.[10]) AS [10]
            , SUM(t.[11]) AS [11]
            , SUM(t.[12]) AS [12]
        FROM
            s03.requests t
        WHERE
            t.category_id = @category_id
            AND t.time_id = @time_id
            AND t.entity_id = COALESCE(@entity_id, t.entity_id)
        GROUP BY
            t.category_id
            , t.time_id
            , t.account_id
            , t.entity_id
        HAVING
            entity_id IS NOT NULL
        UNION ALL
        SELECT
            'regions' AS section
            , t.category_id
            , t.time_id
            , t.account_id
            , NULL AS entity_id
            , NULL AS product_id
            , t.region_id
            , NULL AS subaccount_id
            , SUM(t.[01]) AS [01]
            , SUM(t.[02]) AS [02]
            , SUM(t.[03]) AS [03]
            , SUM(t.[04]) AS [04]
            , SUM(t.[05]) AS [05]
            , SUM(t.[06]) AS [06]
            , SUM(t.[07]) AS [07]
            , SUM(t.[08]) AS [08]
            , SUM(t.[09]) AS [09]
            , SUM(t.[10]) AS [10]
            , SUM(t.[11]) AS [11]
            , SUM(t.[12]) AS [12]
        FROM
            s03.requests t
        WHERE
            t.category_id = @category_id
            AND t.time_id = @time_id
            AND t.entity_id = COALESCE(@entity_id, t.entity_id)
        GROUP BY
            t.category_id
            , t.time_id
            , t.account_id
            , t.region_id
        HAVING
            region_id IS NOT NULL
        UNION ALL
        SELECT
            'products' AS section
            , t.category_id
            , t.time_id
            , t.account_id
            , NULL AS entity_id
            , t.product_id
            , NULL AS region_id
            , NULL AS subaccount_id
            , SUM(t.[01]) AS [01]
            , SUM(t.[02]) AS [02]
            , SUM(t.[03]) AS [03]
            , SUM(t.[04]) AS [04]
            , SUM(t.[05]) AS [05]
            , SUM(t.[06]) AS [06]
            , SUM(t.[07]) AS [07]
            , SUM(t.[08]) AS [08]
            , SUM(t.[09]) AS [09]
            , SUM(t.[10]) AS [10]
            , SUM(t.[11]) AS [11]
            , SUM(t.[12]) AS [12]
        FROM
            s03.requests t
        WHERE
            t.category_id = @category_id
            AND t.time_id = @time_id
            AND t.entity_id = COALESCE(@entity_id, t.entity_id)
        GROUP BY
            t.category_id
            , t.time_id
            , t.account_id
            , t.product_id
        HAVING
            product_id IS NOT NULL
        UNION ALL
        SELECT
            'region_products' AS section
            , t.category_id
            , t.time_id
            , t.account_id
            , NULL AS entity_id
            , t.product_id
            , t.region_id
            , NULL AS subaccount_id
            , SUM(t.[01]) AS [01]
            , SUM(t.[02]) AS [02]
            , SUM(t.[03]) AS [03]
            , SUM(t.[04]) AS [04]
            , SUM(t.[05]) AS [05]
            , SUM(t.[06]) AS [06]
            , SUM(t.[07]) AS [07]
            , SUM(t.[08]) AS [08]
            , SUM(t.[09]) AS [09]
            , SUM(t.[10]) AS [10]
            , SUM(t.[11]) AS [11]
            , SUM(t.[12]) AS [12]
        FROM
            s03.requests t
        WHERE
            t.category_id = @category_id
            AND t.time_id = @time_id
            AND t.entity_id = COALESCE(@entity_id, t.entity_id)
        GROUP BY
            t.category_id
            , t.time_id
            , t.account_id
            , t.region_id
            , t.product_id
        HAVING
            region_id IS NOT NULL
            AND product_id IS NOT NULL
        UNION ALL
        SELECT
            'subaccounts' AS section
            , t.category_id
            , t.time_id
            , t.account_id
            , NULL AS entity_id
            , NULL AS product_id
            , NULL AS region_id
            , t.subaccount_id
            , SUM(t.[01]) AS [01]
            , SUM(t.[02]) AS [02]
            , SUM(t.[03]) AS [03]
            , SUM(t.[04]) AS [04]
            , SUM(t.[05]) AS [05]
            , SUM(t.[06]) AS [06]
            , SUM(t.[07]) AS [07]
            , SUM(t.[08]) AS [08]
            , SUM(t.[09]) AS [09]
            , SUM(t.[10]) AS [10]
            , SUM(t.[11]) AS [11]
            , SUM(t.[12]) AS [12]
        FROM
            s03.requests t
        WHERE
            t.category_id = @category_id
            AND t.time_id = @time_id
            AND t.entity_id = COALESCE(@entity_id, t.entity_id)
        GROUP BY
            t.category_id
            , t.time_id
            , t.account_id
            , t.subaccount_id
        HAVING
            subaccount_id IS NOT NULL
    ) t
    INNER JOIN s03.members m1 ON m1.id = t.category_id
    INNER JOIN s03.members m2 ON m2.id = t.time_id
    INNER JOIN s03.members m3 ON m3.id = t.account_id
    LEFT OUTER JOIN s03.members m4 ON m4.id = t.entity_id
    LEFT OUTER JOIN s03.members m5 ON m5.id = t.region_id
    LEFT OUTER JOIN s03.members m6 ON m6.id = t.product_id
    LEFT OUTER JOIN s03.members m7 ON m7.id = t.subaccount_id
ORDER BY
    code

END


GO

