-- Description: The procedure cleans the request data
-- =============================================

CREATE PROCEDURE [s03].[xl_actions_clean_requests]
    @category_id int = NULL
    , @time_id int = NULL
    , @entity_id int = NULL
    , @set_1_to_delete tinyint = NULL
AS
BEGIN

SET NOCOUNT ON

DECLARE @message nvarchar(max)

IF NOT COALESCE(@set_1_to_delete, 0) = 1
    BEGIN
    SET @message = 'Set 1 in the parameter to delete data'
    RAISERROR (@message, 11, 0)
    RETURN
    END

DELETE FROM s03.requests
WHERE
    category_id = @category_id
    AND [time_id] = @time_id
    AND [entity_id] = COALESCE(@entity_id, [entity_id])

END


