-- =============================================
-- Author:      Gartle LLC
-- Release:     10.0, 2022-07-05
-- Description: The procedure clones the request data
-- =============================================

CREATE PROCEDURE [s03].[xl_actions_clone_requests]
    @source_category_id int = NULL
    , @source_time_id int = NULL
    , @source_entity_id int = NULL
    , @target_category_id int = NULL
    , @target_time_id int = NULL
    , @target_entity_id int = NULL
    , @set_1_to_copy tinyint = NULL
AS
BEGIN

SET NOCOUNT ON

DECLARE @message nvarchar(max)

IF NOT COALESCE(@set_1_to_copy, 0) = 1
    BEGIN
    SET @message = 'Set 1 in the parameter to copy data'
    RAISERROR (@message, 11, 0)
    RETURN
    END

BEGIN TRANSACTION

BEGIN TRY

    INSERT INTO s03.requests
        ( entity_id
        , category_id
        , time_id
        , row_index
        , row_format
        , comment
        , account_id
        , subaccount_id
        , product_id
        , region_id
        , total
        , [01], [02], [03], [04], [05], [06], [07], [08], [09], [10], [11], [12]
        , row_formulas
        , transaction_start_time
        )
    SELECT
        COALESCE(@target_entity_id, f.entity_id)
        , @target_category_id
        , @target_time_id
        , row_index
        , row_format
        , comment
        , account_id
        , subaccount_id
        , product_id
        , region_id
        , total
        , [01], [02], [03], [04], [05], [06], [07], [08], [09], [10], [11], [12]
        , row_formulas
        , transaction_start_time
    FROM
        s03.requests f
    WHERE
        f.category_id = @source_category_id
        AND f.time_id = @source_time_id
        AND f.entity_id = COALESCE(@source_entity_id, f.entity_id)

END TRY

BEGIN CATCH
    SELECT @message = ERROR_MESSAGE()

    IF @@TRANCOUNT > 0
        ROLLBACK TRANSACTION

    RAISERROR (@message, 11, 0, @message)
    RETURN

END CATCH

IF @@TRANCOUNT > 0
    COMMIT TRANSACTION

END


GO

-- =============================================
-- Author:      Gartle LLC
-- Release:     10.0, 2022-07-05
-- Description: The procedure selects report cell data to an Excel window
-- =============================================

CREATE PROCEDURE [s03].[xl_details_report_cell_data]
    @category_id int = NULL
    , @time_id int = NULL
    , @entity_id int = NULL
    , @column_name nvarchar(128) = NULL
    , @account nvarchar(128) = NULL
    , @code1 nvarchar(128) = NULL
    , @code2 nvarchar(128) = NULL
    , @data_language varchar(10) = NULL
AS
BEGIN

SET NOCOUNT ON

IF @entity_id = 0 SET @entity_id = NULL

DECLARE @id0 int, @id1 int, @id2 int

SELECT @id0 = id FROM s03.members WHERE code = @account
SELECT @id1 = id FROM s03.members WHERE code = @code1
SELECT @id2 = id FROM s03.members WHERE code = @code2

SELECT
    m4.code AS entity
    , t.comment
    , m1.code AS account
    , m7.name AS subaccount
    , m6.code AS product
    , m5.code AS region
    , t.total
    , t.[01]
    , t.[02]
    , t.[03]
    , t.[04]
    , t.[05]
    , t.[06]
    , t.[07]
    , t.[08]
    , t.[09]
    , t.[10]
    , t.[11]
    , t.[12]
FROM
    s03.requests t
    INNER JOIN s03.members m1 ON m1.id = t.account_id
    INNER JOIN s03.members m4 ON m4.id = t.[entity_id]
    LEFT OUTER JOIN s03.members m5 ON m5.id = t.region_id
    LEFT OUTER JOIN s03.members m6 ON m6.id = t.product_id
    LEFT OUTER JOIN s03.members m7 ON m7.id = t.subaccount_id
WHERE
    t.category_id = @category_id
    AND t.[time_id] = @time_id
    AND t.[entity_id] = COALESCE(@entity_id, t.[entity_id])
    AND t.account_id = @id0
    AND (COALESCE(t.region_id, 0) = COALESCE(@id1, t.region_id, 0)
        OR COALESCE(t.product_id, 0) = COALESCE(@id1, t.product_id, 0)
        OR COALESCE(t.subaccount_id, 0) = COALESCE(@id1, t.subaccount_id, 0)
        )
    AND (COALESCE(t.region_id, 0) = COALESCE(@id2, t.region_id, 0)
        OR COALESCE(t.product_id, 0) = COALESCE(@id2, t.product_id, 0)
        OR COALESCE(t.subaccount_id, 0) = COALESCE(@id2, t.subaccount_id, 0)
        )

END


