CREATE PROCEDURE [s03].[xl_list_member_id]
    @dimension_id int = NULL
    , @name_format_id tinyint = NULL
AS
BEGIN

SELECT
    m.id
    , CASE @name_format_id
        WHEN 1 THEN m.name
        WHEN 2 THEN CAST(m.id AS nvarchar)
        WHEN 3 THEN CAST(m.id AS nvarchar) + ' ' + m.name
        WHEN 4 THEN m.code + ' ' + m.name
        ELSE m.code END AS name
FROM
    s03.members m
WHERE
    m.dimension_id = @dimension_id
ORDER BY
    name

END


